import './App.css';
import Card from './Component/Card/Card';

function App() {
  return (
    <div className='parent_header'>
    <div className='product_container'>
      <div className='header_title'>
          <h3>Fitness Freak</h3>
      </div>
      <div>
        <Card></Card>
      </div>
    </div>
    <div className='activity_container'>
      <h3>Activity Info</h3>
    </div>
    </div>
  );
}

export default App;
